INSERT INTO `roles` VALUES (1,'ProgramOwner','{\"read\": [\"Cycle\", \"ObjectDocument\", \"ObjectObjective\", \"ObjectPerson\", \"ObjectSection\", \"Program\", \"ProgramControl\", \"ProgramDirective\", \"Relationship\", \"UserRole\"], \"create\": [\"Cycle\", \"ObjectDocument\", \"ObjectObjective\", \"ObjectPerson\", \"ObjectSection\", \"Program\", \"ProgramControl\", \"ProgramDirective\", \"Relationship\", \"UserRole\"], \"update\": [\"Cycle\", \"ObjectDocument\", \"ObjectObjective\", \"ObjectPerson\", \"ObjectSection\", \"Program\", \"ProgramControl\", \"ProgramDirective\", \"Relationship\", \"UserRole\"], \"delete\": [\"Cycle\", \"ObjectDocument\", \"ObjectObjective\", \"ObjectPerson\", \"ObjectSection\", \"Program\", \"ProgramControl\", \"ProgramDirective\", \"Relationship\", \"UserRole\"]}','User with authorization to peform administrative tasks such as associating users to roles within the scope of of a program.<br/><br/>When a person creates a program they are automatically given the ProgramOwner role. This allows them to Edit, Delete, or Map objects to the Program. It also allows them to add people and assign them roles when their programs are private. ProgramOwner is the most powerful role.',NULL,'2013-10-11 22:10:44','2013-10-11 22:10:44',1,'Private Program'),(2,'ProgramEditor','{\"read\": [\"Cycle\", \"ObjectDocument\", \"ObjectObjective\", \"ObjectPerson\", \"ObjectSection\", \"Program\", \"ProgramControl\", \"ProgramDirective\", \"Relationship\"], \"create\": [\"Cycle\", \"ObjectDocument\", \"ObjectObjective\", \"ObjectPerson\", \"ObjectSection\", \"Program\", \"ProgramControl\", \"ProgramDirective\", \"Relationship\"], \"update\": [\"Cycle\", \"ObjectDocument\", \"ObjectObjective\", \"ObjectPerson\", \"ObjectSection\", \"Program\", \"ProgramControl\", \"ProgramDirective\", \"Relationship\"], \"delete\": [\"Cycle\", \"ObjectDocument\", \"ObjectObjective\", \"ObjectPerson\", \"ObjectSection\", \"ProgramControl\", \"ProgramDirective\", \"Relationship\"]}','A user with authorization to edit mapping objects related to an access controlled program.<br/><br/>When a person has this role they can map and unmap objects to the Program but they are unable to edit the Program info, delete the Program, or assign other people roles for that program.',NULL,'2013-10-11 22:10:44','2013-10-11 22:10:44',1,'Private Program'),(3,'ProgramReader','{\"read\": [\"Cycle\", \"ObjectDocument\", \"ObjectObjective\", \"ObjectPerson\", \"ObjectSection\", \"Program\", \"ProgramControl\", \"ProgramDirective\", \"Relationship\"], \"create\": [], \"update\": [], \"delete\": []}','A user with authorization to read mapping objects related to an access controlled Program.<br/><br/>This is essentially a view only role. A person with this role can access and view an otherwise private program, but they cannot map to or edit that program in any way.',NULL,'2013-10-11 22:10:44','2013-10-11 22:10:44',1,'Private Program'),(4,'RoleReader','{\"read\": [\"Role\"], \"create\": [], \"update\": [], \"delete\": []}','A user with authorization to read Role resources.',NULL,'2013-10-11 22:10:44','2013-10-11 22:10:44',1,NULL),(5,'Reader','{\"read\": [\"Categorization\", \"Category\", \"Control\", \"ControlControl\", \"ControlSection\", \"Cycle\", \"DataAsset\", \"Directive\", \"Contract\", \"Policy\", \"Regulation\", \"DirectiveControl\", \"Document\", \"Facility\", \"Help\", \"Market\", \"Objective\", \"ObjectiveControl\", \"ObjectControl\", \"ObjectDocument\", \"ObjectObjective\", \"ObjectPerson\", \"ObjectSection\", \"Option\", \"OrgGroup\", \"PopulationSample\", \"Product\", \"ProgramControl\", \"ProgramDirective\", \"Project\", \"Relationship\", \"RelationshipType\", \"Section\", \"SectionObjective\", \"SystemOrProcess\", \"System\", \"Process\", \"SystemControl\", \"SystemSystem\", \"Person\", \"Program\", \"Role\"]}','This role grants a user basic, read-only, access permission to a gGRC instance.',NULL,'2013-10-11 22:10:44','2013-10-11 22:10:44',NULL,'System'),(6,'ObjectEditor','{\"read\": [\"Categorization\", \"Category\", \"Control\", \"ControlControl\", \"ControlSection\", \"Cycle\", \"DataAsset\", \"Directive\", \"Contract\", \"Policy\", \"Regulation\", \"DirectiveControl\", \"Document\", \"Facility\", \"Help\", \"Market\", \"Objective\", \"ObjectiveControl\", \"ObjectControl\", \"ObjectDocument\", \"ObjectObjective\", \"ObjectPerson\", \"ObjectSection\", \"Option\", \"OrgGroup\", \"PopulationSample\", \"Product\", \"ProgramControl\", \"ProgramDirective\", \"Project\", \"Relationship\", \"RelationshipType\", \"Section\", \"SectionObjective\", \"SystemOrProcess\", \"System\", \"Process\", \"SystemControl\", \"SystemSystem\", \"Person\", \"Program\", \"Role\"], \"create\": [\"Categorization\", \"Category\", \"Control\", \"ControlControl\", \"ControlSection\", \"Cycle\", \"DataAsset\", \"Directive\", \"Contract\", \"Policy\", \"Regulation\", \"DirectiveControl\", \"Document\", \"Facility\", \"Help\", \"Market\", \"Objective\", \"ObjectiveControl\", \"ObjectControl\", \"ObjectDocument\", \"ObjectObjective\", \"ObjectPerson\", \"ObjectSection\", \"Option\", \"OrgGroup\", \"PopulationSample\", \"Product\", \"ProgramControl\", \"ProgramDirective\", \"Project\", \"Relationship\", \"RelationshipType\", \"Section\", \"SectionObjective\", \"SystemOrProcess\", \"System\", \"Process\", \"SystemControl\", \"SystemSystem\", \"Person\"], \"update\": [\"Categorization\", \"Category\", \"Control\", \"ControlControl\", \"ControlSection\", \"Cycle\", \"DataAsset\", \"Directive\", \"Contract\", \"Policy\", \"Regulation\", \"DirectiveControl\", \"Document\", \"Facility\", \"Help\", \"Market\", \"Objective\", \"ObjectiveControl\", \"ObjectControl\", \"ObjectDocument\", \"ObjectObjective\", \"ObjectPerson\", \"ObjectSection\", \"Option\", \"OrgGroup\", \"PopulationSample\", \"Product\", \"ProgramControl\", \"ProgramDirective\", \"Project\", \"Relationship\", \"RelationshipType\", \"Section\", \"SectionObjective\", \"SystemOrProcess\", \"System\", \"Process\", \"SystemControl\", \"SystemSystem\", \"Person\"], \"delete\": [\"Categorization\", \"Category\", \"Control\", \"ControlControl\", \"ControlSection\", \"Cycle\", \"DataAsset\", \"Directive\", \"Contract\", \"Policy\", \"Regulation\", \"DirectiveControl\", \"Document\", \"Facility\", \"Help\", \"Market\", \"Objective\", \"ObjectiveControl\", \"ObjectControl\", \"ObjectDocument\", \"ObjectObjective\", \"ObjectPerson\", \"ObjectSection\", \"Option\", \"OrgGroup\", \"PopulationSample\", \"Product\", \"ProgramControl\", \"ProgramDirective\", \"Project\", \"Relationship\", \"RelationshipType\", \"Section\", \"SectionObjective\", \"SystemOrProcess\", \"System\", \"Process\", \"SystemControl\", \"SystemSystem\"]}','This role grants a user basic object creation and editing permission.',NULL,'2013-10-11 22:10:44','2013-10-11 22:10:44',NULL,'System'),(7,'ProgramCreator','{\"create\": [\"Program\"]}','This role grants a user the permission to create public and private programs.',NULL,'2013-10-11 22:10:44','2013-10-11 22:10:44',NULL,'System'),(8,'System Administrator','{\"__GGRC_ADMIN__\": [\"__GGRC_ALL__\"]}','gGRC System Administrator with super-user privileges',NULL,'2013-10-11 22:10:44','2013-10-11 22:10:44',NULL,'Admin');
